INSERT INTO transfertarea VALUES ('230', '3148', '7000', 1358533267, 1358533275, 'Observaciones : Refiere el usuario en su queja: Lo acontecido en esta fecha ( 16-01-013) fue lo siguiente; Llegue a una cita donde el Odontólogo - cirujano para que me extrajera unas muelas y me dicen que debo traer la Radiografía (cosa que me parece de forma difícil) porque como la cita fue vía telefónica la  niña que me atendió no me pidió traerlo. Solo documentos de identificación me pidió traer los documentos de identificación y las de la autorización los cuales traje. El asunto es que ahora el médico y sus colaboradores me acusan de tener la culpa por no suponer y traerla lo que me parece TERRIBLE. Además de perder el tiempo de trabajo y mis transportes no me presentan ni siquiera una disculpa, sino que me dicen que o me valoran y luego saco otra cita o que simplemente me cambian la cita. Lo que pasa es que me toca pagar el tiempo laboral y los transportes, también mi EPS debe pagar otra cita.');
