INSERT INTO transfertarea VALUES ('345', '4483', '8000', 1364849920, 1364849927, 'Asunto: Drecho de Petición Reclamante: Carmen Andrea Rivas Jiménez. C.C. 27.090.612. Paciente: Edgar Anibal Rivas Jiménez. C.C. 12.754.870. HC 2189385. Teléfono 7309854  7321891. Cel: 3207650394. Dirección: Diagonal 16D No. 6E-28 F. Barrio El Rosario - Pasto. Con el fundamento en el artículo 23 de la Constitución Política de Colombia, respetuosamente me dirijo a ustedes con el fin de solicitar me sea otorgada copia del resultado completo de la patología realizada a mi hermano Edgar Anival Rivas Jiménez, identificado con cédula No. 12.754.870, examen que fue ordenado el día 19 de noviembre del año 2012 en la unidad de neurocirugía del HUV, y que está consignado en la historia clínica número 2189385. ');
