INSERT INTO transfertarea VALUES ('363', '4715', '6232', 1365606020, 1365606029, 'Observaciones : Asunto: Queja. Reclamante: Paola A. Villa C.C.1130647037. Paciente: Julian Villa. HC 2034290 Cel: 3206167200. Funcionario: Dra. Juliana Bejarano. La usuaria manifiesta: Mi queja es para referirme a la falta de respeto para con nosotros los pacientes, no es justo que nos hagan venir a una cita, la cual no nos van a atender por irresponsabilidad de los médicos, es injusto e increíble que en un hospital tan reconocido los médicos no tengan una agenda para saber cuantos pacientes deben atender ese día, a uno nadie le va a responder por los pasajes, el tiempo perdido, porque uno llama y ni siquiera le contestan y los que contestan son unos groseros. Agradezco la atención prestada, ojala cambien esa actitud, porque sino nos veremos en el deber de quejarnos en la Secretaría de Salud.');
INSERT INTO transfertarea VALUES ('365', '4692', '7037', 1365682493, 1365682530, 'Observaciones : La usuaria Manifiesta: Yo Johana Andrea Morales, con CC 38644474, soy la madre del niño Harold Fabian García Morales, con historia 1641517, quien nació con multiples malformaciones y debido a eso tiene sonda de gastrostomia para su alimentación. Mi incomodidad es porque antes me daban las cita para las horas de la mañana y se me facilitaba más, pues podía llevar a mi otra hija al colegio y ahí salir para la cita con Harold, después salia para Emssanar y autorizaba los medicamentos y demás. Pero ahora con el cambio de horario se me dificulta más en cuanto a lo económico y a el cuidado de mis otros niños, pues vivo sola con ellos y para poder traeer a Harold a su control me toca pagar par que se queden en la tarde cuidandolos. Mi petición es que vuelvan a pasar las citas de Nutrición y Dietética para las horas de la mañana, que resulta más comodo y favorable. De antemano muchas gracias.');
