INSERT INTO transfertarea VALUES ('467', '5660', '4000', 1371483620, 1371483627, 'Observaciones : Asunto: Derecho de Petición. Juana del Carmen Isuasty Rincón, identificada con cédula No. 29588534 de la Cumbre Valle, residente en Lomitas, Jurisdicción del municipio de la Cumbre, con número de celular 3122314773 en ejercicio del derecho de petición, consagrado en el artículo 23 de la constitución nacional y en el artículo 5 del código contencioso administrativo, solicito a usted lo siguiente: Hechos. El día 22 de enero de 2013 el especialista en Oncología José Fernando Reyes me ordenó la práctica de Tiroidectomía total 500 + biopsia por congelación, la cual lleve a Cafesalud EPS de la Cumbre para que me fuera autorizada y me fue entregad a los ocho días. Después de recibir la autorización me dirigí al Hospital Universitario con el fin de realizar todos los trámites necesarios para que se me practicara la operación y me dieron la orden con el anestesiólogo a la cual fui y me dieron la autorización para la anestesia y me hicieron todos los exámenes requeridos para real');
