INSERT INTO transfertarea VALUES ('3566', '41755', '1200', 1481749374, 1481749411, 'Respetados señores, En el transcurso de este año 2016 se les ha solicitado el certificado de donación correspondiente a DISTRIBUIDORA SICMAFARMA S.A.S, con NIT 900.332.426-3 el cual se soporta mediante factura 25250 del 18 de febrero de 2016. A quien inicialmente se le realizo la solicitud del certificado de donación fue al funcionario YUDY SHIRLEY CASTAÑEDA VALENCIA posteriormente se le ha venido realizando la solicitud al funcionario LINA GARCIA - AUXILIAR ADMINISTRATIVA, pero nadie da respuesta. Como ustedes saben tributariamente esta situación afecta la deducción en el impuesto de renta a la cual tenemos derecho según lo estipulado en el Estatuto Tributario Art.125. "Deducción por donaciones". Ante esta situación nos vemos en la obligación de solicitarlo por este medio ante la negligencia de los funcionarios que evaden sus responsabilidades y niegan entregar un correo electrónico para la solicitud y más siendo ustedes una entidad pública obligada a certificar este tipo de acciones.');
