INSERT INTO transfertarea VALUES ('5667', '56886', '9800', 1535737788, 1535739323, 'Es importante informar ala usuaria que dad las condiciones  de niños prematuros,algunos en el programa canguro el Hospital Universitario del Valle como Institucion Cerfificada IAMI ha realizado extensión de la permanencia de  las madres con el objetivo de garantizar el contacto piel a piel,la lactancia materna,el vinculo afectivo,en este sentido se debe entender la prrioridad dada  a los padres;sin alejarnos de la atención humanizada se a concedido un espacio de tiempo a los abuelos el dí viernes. La opción de ampliación de  horaarios de visitas se concede cuando los niños superan su proceso critico y en caso de necesitar continuar hospitalizados se pasen a las salas.');
INSERT INTO transfertarea VALUES ('5668', '56954', '8000', 1535658686, 1535751954, NULL);
INSERT INTO transfertarea VALUES ('5669', '56954', '2000', 1535750663, 1535751954, 'Se da respuesta a queja interpuesta por la Acudiente Amparo Guerrero, familiar del paciente GERMÁN PILL SOTO, paciente hospitalizado en Urgencias, La Sra.  Amparo hace 2 semanas me la encuentró en el 4 piso hospitalización "Muy alterada", "Muy enojada", le pregunto que le sucede: - estoy buscando al Doctor Gomez de Neurocirugía que tiene unos CD de mi paciente que se encuentra en Urgencias. Le comunico que al Doctor Gomez debe buscarlo en oficina de Neurocirugía de la Universidad del Valle o en Urgencias, sigue muy enojada y alterada, le digo que voy hacerle el favor de tratar de comunicarme con el Doctor Gomez. Lo logró ubicar y me refiere que el no tiene los CD.
INSERT INTO transfertarea VALUES ('5670', '56894', '9000', 1535044514, 1535752193, NULL);
INSERT INTO transfertarea VALUES ('5671', '56894', '9800', 1535750919, 1535752193, 'Es importante que lla usuaria conozca que el HUV es una institución certificada como IAMI (institución amiga de la  mujer y la infancia y que adherida a esta politica  ha extendido y gaarantizado el acompañamiento de los niños y con enfasis en los prematuros enel acompañamiento de la madre,el fortalecimiento de la lactancia materna y el contacto piel a piel de la madre. Comprendiendo el papel importante de los abuelos y hermanitos se abrio un espacio de visita para estos,pero en realidad la prioridad del tiempo mientras los niños permanezcan en  cirena es la madre,cuando los niños mejoren su estado y si continuan  cn su hospitalizacion en otro servicio pediatrico,el tiempo y los acompañantes no tendrán ninguna restriccion;estos procesos garantizan la prevención de infecciones y complicaciones en los recien nacidos prematuros');
INSERT INTO transfertarea VALUES ('5672', '56898', '9000', 1535050680, 1535752386, NULL);
INSERT INTO transfertarea VALUES ('5673', '56898', '9800', 1535751127, 1535752386, 'En las unidades de cuidado intensivo neonaltal se amplia horaario de visita sin restriciones para padre y madre favorenciendo el contacto piel a piel (canguro) y la lactancia materna. De igual manera se facilita la visita de hermanitos y abuelos. La prioridad es la proteccion y fortaleciemiento del vinculo afectivo del niño y su madre;una vez se traslade a piso si continua hospitalizado no hay restrición en la visita de otros familiiares');
